import React from 'react';
import {Router, Route, Link, Switch} from 'react-router-dom';
import InnerHeader from './InnerHeader';
import MatchesList from './MatchesList';
import PredictionCreate from './PredictionCreate';
import PastPredictions from './PastPredictions';
import history from '../../history';

const PredictionsContainer = () =>{
  return(
    <div className = "ui container">
      <Router history={history}>
        <div>
          <InnerHeader />
          <Switch>
            <Route path="/matches" component={MatchesList} />
            <Route path="/matches/:id/predict" exact component={PredictionCreate} />
            <Route path="/pastPredictions" exact component={PastPredictions} />
          </Switch>
        </div>
      </Router>
    </div>
  );
};

export default PredictionsContainer;
